protected List<Tuple> getTuples(TupleStream tupleStream) throws IOException {
  tupleStream.open();
  List<Tuple> tuples = new ArrayList();
  for(;;) {
    Tuple t = tupleStream.read();
    if(t.EOF) {
      break;
    } else {
      tuples.add(t);
    }
  }
  tupleStream.close();
  return tuples;
}

